css:
.editor-colors {
  background-color: #1a252f;
  color: #bdc3c7;
}
.editor {
  background-color: #1a252f;
  color: #bdc3c7;
}
.editor .wrap-guide {
  background-color: #34495e;
}
.editor .indent-guide {
  color: #34495e;
}
.editor .invisible-character {
  color: #34495e;
}
.editor .markup.underline.link.hyperlink {
  color: #f1c40f;
  text-decoration: underline;
}
.editor .gutter {
  background-color: #34495e;
  color: #bdc3c7;
}
.editor .gutter .line-number.cursor-line {
  background-color: #46637f;
  color: #ecf0f1;
}
.editor .gutter .line-number.cursor-line-no-selection {
  color: #ecf0f1;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #46637f;
}
.editor .invisible {
  color: #bdc3c7;
}
.editor .cursor {
  color: #ffffff;
}
.editor .selection .region {
  background-color: #354c60;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #46637f;
}
.editor .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #587da0;
}
.entity.name.type {
  color: #f0c674;
  text-decoration: underline;
}
.entity.name.tag {
  text-decoration: none !important;
}
.entity.other.inherited-class {
  color: #bdc3c7;
}
.keyword {
  color: #2ecc71;
}
.keyword.control {
  color: #2ecc71;
}
.keyword.operator {
  color: #bdc3c7;
}
.keyword.other.special-method {
  color: #81a2be;
}
.keyword.other.unit {
  color: #de935f;
}
.storage {
  color: #2ecc71;
}
.constant {
  color: #de935f;
}
.constant.character.escape {
  color: #3498db;
}
.constant.numeric {
  color: #de935f;
}
.constant.other.color {
  color: #3498db;
}
.constant.other.symbol {
  color: #bdc3c7;
}
.variable {
  color: #e74c3c;
}
.variable.interpolation {
  color: #d62c1a;
}
.variable.parameter.function {
  color: #bdc3c7;
}
.invalid.illegal {
  background-color: #e74c3c;
  color: #1a252f;
}
.string {
  color: #ecf0f1;
}
.string.regexp {
  color: #3498db;
}
.string.regexp .source.ruby.embedded {
  color: #de935f;
}
.string.other.link {
  color: #e74c3c;
}
.text {
  color: #bdc3c7;
}
.punctuation.definition.comment {
  color: #46637f;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #bdc3c7;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #81a2be;
}
.punctuation.definition.bold {
  color: #f0c674;
  font-style: bold;
}
.punctuation.definition.italic {
  color: #2ecc71;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #d62c1a;
}
.support.class {
  color: #f0c674;
}
.support.function {
  color: #3498db;
}
.support.function.any-method {
  color: #81a2be;
}
.entity.name.function {
  color: #81a2be;
}
.entity.name.class,
.entity.name.type.class {
  color: #f0c674;
}
.entity.name.section {
  color: #81a2be;
}
.entity.name.tag {
  color: #e74c3c;
  text-decoration: underline;
}
.entity.other.attribute-name {
  color: #bdc3c7;
}
.entity.other.attribute-name.id {
  color: #bdc3c7;
}
.meta.class {
  color: #f0c674;
}
.meta.link {
  color: #de935f;
}
.meta.require {
  color: #81a2be;
}
.meta.selector {
  color: #2ecc71;
}
.meta.separator {
  background-color: #34495e;
  color: #bdc3c7;
}
.none {
  color: #bdc3c7;
}
.markup.bold {
  color: #de935f;
  font-style: bold;
}
.markup.changed {
  color: #2ecc71;
}
.markup.deleted {
  color: #e74c3c;
}
.markup.italic {
  color: #2ecc71;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #81a2be;
}
.markup.inserted {
  color: #bdc3c7;
}
.markup.list {
  color: #e74c3c;
}
.markup.quote {
  color: #de935f;
}
.markup.raw.inline {
  color: #bdc3c7;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #bdc3c7;
}
.editor.mini .scroll-view {
  padding-left: 1px;
}
/***************************
**** START CUSTOM ****
***************************/
.php.keyword.control {
  color: #2ecc71;
}
.php.support.function {
  color: #b294bb;
}
.php.variable,
.php.variable.punctuation {
  color: #3498db;
  font-weight: bold;
}
.php.punctuation.section.array.begin,
.php.punctuation.section.array.end {
  color: #b294bb;
  font-weight: bold;
}
.php.punctuation.section.begin,
.php.punctuation.section.end {
  color: #d62c1a;
}
.php.punctuation.definition.string.begin,
.php.punctuation.definition.string.end {
  color: #bdc3c7;
}
.php.punctuation.definition.string.begin,
.php.punctuation.definition.string.end {
  font-weight: bold;
}
.php.punctuation.section.scope.begin,
.php.punctuation.section.scope.end {
  color: #2ecc71;
}
.php.string .string-contents {
  color: #e74c3c;
  font-weight: bold;
}
.html.name.entity.tag,
.html.punctuation.definition.tag.begin,
.html.punctuation.definition.tag.end {
  color: #bdc3c7;
}
.html.punctuation.definition.string.begin,
.html.punctuation.definition.string.end,
.html.punctuation.definition.tag {
  color: #bdc3c7;
}
.css.entity.attribute-name {
  color: #3498db;
}
